return (
<>    
    <img className='basket__product__count__img__decrement' src={imgDecrement} alt=''></img>
        <div className='basket__product__count__result'>{count}</div>
    <img className='basket__product__count__img__increment' onClick={increment} src={imgIncrement} alt=''></img>
</>
)

}

export default Count;
